import { getCategoryRequest } from '../Apis'
import GetCategoryResponseDto from '../Apis/Response/getCategoryResponse.dto';
import { Category } from '../Types/Interface';
import styled from '@emotion/styled'
interface Props{
  categoryItem: Category
}




export default function Header({categoryItem}:Props) {

const{categoryName,categoryDatetime,categoryId}=categoryItem
const[category,setCategory]=useState<Category[]>([]);

const getCategoryResponse =(responseBody:GetCategoryResponseDto|null|undefined)=>{
if(!responseBody) return;
  const{Category}=responseBody as GetCategoryResponseDto;
  setCategory(Category);
}


useEffect(()=>{
  getCategoryRequest().then(getCategoryResponse);
},[])
  return (
   <>
   <HeaderWrapper>
      <HeaderTitle>개발자's Kiosk</HeaderTitle>
      <TabWrapper>
        <a>

        </a>
      </TabWrapper>
   </HeaderWrapper>

   </>
  )
}
const HeaderWrapper = styled.div`
  margin: 0 auto;
  text-align: center;
  margin-top: 60px;
  margin-bottom: 60px;
`
const HeaderTitle = styled.div`
  font-size: 50px;
  font-weight: 800;
`

const TabWrapper = styled.div`
  margin-top: 30px;
  display: flex;
  justify-items: center;
  justify-content: space-around;
`

